import React, { useState, useEffect } from "react";
import csvData from "./bestPitches_ex.csv";

export const Results = () => {
  const [playerData, setPlayerData] = useState("");
  const [searchTerm, setSearchTerm] = useState("");
  const [foundPlayer, setFoundPlayer] = useState(null);

  useEffect(() => {
    const fetchData = async () => {
      const response = await fetch(csvData);
      const data = await response.text();
      let parsedData = data.split("\n").map((row) => row.split(","));
      // Remove any empty rows at the end
      while (parsedData.length > 0 && parsedData[parsedData.length - 1].every((cell) => !cell)) {
        parsedData.pop();
      }
      const headers = parsedData.shift();
      const players = parsedData.map((row) =>
        `<tr>
          <td>${row[0]}</td>
          <td>${row[1]}</td>
          <td>${row[2]}</td>
          <td>${row[3]}</td>
          <td>${row[4]}</td>
        </tr>`
      ).join('');
      setPlayerData(players);
    };
    fetchData();
  }, []);

  useEffect(() => {
    const player = playerData.includes(searchTerm) ? searchTerm : null;
    setFoundPlayer(player);
  }, [searchTerm, playerData]);

  return (
    <div>
      <input
        type="text"
        value={searchTerm}
        onChange={(e) => setSearchTerm(e.target.value)}
      />
      <table style={{ fontSize: "1rem", borderCollapse: "collapse", margin: "auto" }}>
        <thead>
          <tr>
            <th style={{ border: "1px solid black", padding: "10px" }}>Player Name</th>
            <th style={{ border: "1px solid black", padding: "10px" }}>Pitch Type</th>
            <th style={{ border: "1px solid black", padding: "10px" }}>Stuff Grade</th>
            <th style={{ border: "1px solid black", padding: "10px" }}>Release Speed</th>
            <th style={{ border: "1px solid black", padding: "10px" }}>InducedVertBreak</th>
          </tr>
        </thead>
        <tbody dangerouslySetInnerHTML={{ __html: playerData }} />
      </table>
      {foundPlayer ? (
        <p>{foundPlayer}</p>
      ) : (
        <p>Player not found</p>
      )}
    </div>
  );
};
